const Header = () => {
    return (
        <div className="">
        <nav className="navbar bg-light mb-3">
            <div className="container-fluid">
                        <a className="navbar-brand" href="#">Прогноз погоды</a>
            </div>
            <div className="d-flex">
                        {/* <NavProfile /> */}
                        <a className="navbar-brand" href="#">Вход/Регистрация</a>
            </div>
        </nav>
        </div>
    );
};

export default Header;
